const App = () => {

const [state, dispatch] = useReducer(reducer,{email:'', pwd:''})

  return (
    <div className={`app`}>

      <input
        className='inp_css'
        value={state.email}
        onChange={() => dispatchEvent()}
        placeholder='Enter Email'
        type='email'
      />

      <input
        className='inp_css'
        value={state.pwd}
        onChange={() => dispatchEvent()}
        placeholder='Enter Password'
        type='password'
      />


    </div>
  )
}

export default App
